INSERT INTO `departamento` (`departamento_id`, `nombre`, `icono_fa`, `descripcion`, `borrado`) VALUES
(1, 'Dirección de Informática', 'fa-desktop', 'La Dirección de Informática es la unidad organizativa administrativa con adscripción a la Vicerrectoría Administrativa, la cual realiza funciones de naturaleza directivas, técnica y de servicios en ma', 0),
(2, 'Gestión y Resguardo de la Producción', 'fa-cogs', 'Garantizar, Administrar y optimizar el funcionamiento y la operatividad en el área de información y servicio de la DIUC, custodiar la información y mantener una estructura de datos cónsona con las dem', 0),
(3, 'Gestión para el Desarrollo de Software', 'fa-laptop', 'Esta unidad es la encargada de coordinar, supervisar y ejecutar las diferentes actividades técnicas y administrativas del área que da soporte a la gestión académico-administrativa de la Institución pe', 0),
(4, 'Gestión de Cálculo Masivo y Mantenimiento de Sistemas', 'fa-suitcase', 'Gestiona actividades técnicas y administrativas para llevar el mantenimiento de los sistemas de información y/o comunicaciones, y para llevar a cabo los cálculos masivos de acuerdo a los requerimiento', 0),
(5, 'Gestión para la Aplicación de Nuevas Tecnologías', 'fa-tasks', 'Gestiona iniciativas de IT efectivas y oportunas destinadas al desarrollo del sistema automatizado que integre los procesos administrativos, con incidencia en la ejecución presupuestaria y financiera,', 0),
(6, 'Soporte Técnico y Atención al Usuario', 'fa-gavel', 'Mantiene la operatividad y funcionalidad de la infraestructura tecnológica que soporta los servicios de información y comunicación de la institución, así como la administración del ambiente de los usu', 0),
(7, 'Administración', 'fa-shield', 'Se ocupa de la ejecución y control de las actividades de planificación y ejecución administrativa y financiera de acuerdo a las normativas establecidas. Custodia de los fondos y demás valores financie', 0);
